import React from 'react';
import { Container, Row, Col } from 'reactstrap';

export default class Content extends React.Component {
  render() {
      var my_result={background:'#E5E8E8', height:'40px'}
    return (
      <Container fluid>
        <Row>
          <Col xs="6">
              <div style={my_result}>
                  <a>Result:_____________near_______________</a>
              </div>

              <div className='float-right'>
              <p>Sort by :</p>
              </div>
              
              <div className="mt-4 ml-5" width="132px">
              <img src={require('./ming.jpg')} width="90px"/>
              </div>
          </Col>
          <Col xs="6">.col-6</Col>
        </Row>
      </Container>
    );
  }
}
